import React from "react";
import { Formik, Form } from "formik";
import { Container, Row, Col, Input, Button } from "@material-ui/core";

function App() {
  return (
    <div className='App'>
      <Container>
        <Row>
          <Col>
            <Formik
              initialValues={{ file: "" }}
              onSubmit={(values) => {
                console.log(values);
              }}
            >
              {(formProps) => (
                <Form>
                  <Input
                    type='file'
                    name='archive'
                    onChange={(event) => {
                      formProps.setFieldValue("file", event.target);
                    }}
                  ></Input>
                  <Button type='submit'>Submit</Button>
                </Form>
              )}
            </Formik>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
